import Card from "./Card"


const Projects = () => {

    const Project1 = {
        title: "Weather App",
        body: 'ZipCode Driven Open API',
        image: 'image link',
        link: 'https://stevebecmpe.github.io/ECMPE-Weather-App/'
    }
    const Project2 = {
        title: "project 2 title",
        body: 'project 2 body',
        image: 'image link'
    }
    const Project3 = {
        title: "project 3 title",
        body: 'project 3 body',
        image: 'image link'
    }

    return (
        <div className="home">
           <h1 className="mainHeader">Projects PAGE MAIN HEADER</h1>
           <Card CardContent={Project1} />
           <Card CardContent={Project2} />
           <Card CardContent={Project3} />

        </div>
    );
}

export default Projects;
